import React from 'react';
import './Main.css';
import Header from './Header/Header';
import Body from './Body/Body';
import Footer from './Footer/Footer';


class Main extends React.Component{
  render(){
      return(
        <div>
            <Header></Header>
            <Body></Body>
            <Footer></Footer>
            <a href="javascript:" clá="return-to-top" data-toggle="tooltip"><i class="icon-chevron-up"></i></a>
            <a href="javascript:" id="return-to-bottom" data-toggle="tooltip"><i class="icon-chevron-down"></i></a>
        </div>
      )
  }
}
export default Main;
